import Jumbotron from '../presentational/Jumbotron';
import { Container } from 'react-bootstrap';
const About = () => {
    return (
        <div>
            <Jumbotron jumboShow = {false} />

            <h1>About Page</h1>
        </div>
    )
}

export default About
